import { Input,Form, Button } from "antd";
const onFinish = (data) =>{
    console.log(data);
}
const SignUp = () =>{
    return (
       <Form  onFinish={onFinish}> 
       <Form.Item name  = "email"
       rules={[{},{}]}></Form.Item>
       
       <Input placeholder="Username"/>
       <Input placeholder="Passwords"/>
       <Button htmlType="submit"> Login</Button>
       </Form>
    )
}
export default SignUp;
